def run(value_list):
    """
    Calculates the change in operating revenue under continuing operations from 2018 to 2019.

    Args:
        value_list: A list of dictionaries, where each dictionary represents a financial data point.

    Returns:
        A tuple containing the change in operating revenue and its scale.
    """

    revenue_2019 = None
    revenue_2018 = None

    for item in value_list:
        if item['category'] == 'Opereating revenue' and item['header1'] == 'Continuing Operations' and item['header2'] == '2019 $thousand':
            revenue_2019 = item['number_value']
        if item['category'] == 'Opereating revenue' and item['header1'] == 'Continuing Operations' and item['header2'] == '2018 $thousand RESTATED3':
            revenue_2018 = item['number_value']

    if revenue_2019 is not None and revenue_2018 is not None:
        change = revenue_2019 - revenue_2018
        if change >= 0:
            scale = 'thousand'
        else:
            scale = 'percent'
        return (round(change, 2), scale)
    else:
        return (0.0, '')

