def run(value_list):
    """
    Calculates the percentage change in the weighted average hedged rate from 2018 to 2019.

    Args:
        value_list: A list of dictionaries, where each dictionary represents a financial value.

    Returns:
        A tuple containing the percentage change (float with two decimal places) and the scale ('percent').
    """

    rate_2018 = None
    rate_2019 = None

    for item in value_list:
        if item['category'] == 'Weighted average hedged rate for the year' and item['header3'] == '2018':
            rate_2018 = item['number_value']
        if item['category'] == 'Weighted average hedged rate for the year' and item['header3'] == '2019':
            rate_2019 = item['number_value']

    if rate_2018 is not None and rate_2019 is not None:
        percentage_change = ((rate_2019 - rate_2018) / rate_2018) * 100
        return (round(percentage_change, 2), 'percent')
    else:
        return (None, '')
